    const [email, setEmailName] = useState('');
    const [firstDOB, setDOB] = useState('');

    const register = () => {
        Axios.post('http://localhost:8080/api/v1/users', { // local address to work with android emulator, do not use localhost
            firstName: firstName,
        }).then((response) => {
            console.log(response.data);
        }).catch((err) => {
            console.log("Promise Rejected", err.response.data);
